import _ from 'lodash'
import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import { connect } from 'react-redux'
import { fetchposts, togg } from '../actions/notes'
import PostRender from './PostRender'
import PropTypes from 'prop-types'
import { Field, reduxForm } from 'redux-form'
import logor from '../img/planet.jpg'
import log from '../img/green.jpg'
import lo from '../img/kris.jpg'

class PostList extends Component {
  constructor (props) {
    super(props)
    this.state = {
      likes: 15
    }
  }

  componentDidMount () {
    this.props.fetchposts()
  }

  navigateright () {
    this.props.fetchposts(this.props.posts.next)
  }
  navigateleft () {
    this.props.fetchposts(this.props.posts.previous)
  }

  render () {
    console.log(this.props)
    const { posts } = this.props
    const { likes } = this.state
    const value = {
      'name': 'hello'
    }
    if (!posts) {
      return (<h1>Loading.......</h1>)
    }

    return (
      <div>
      <div className="bd-example">
  <div id="carouselExampleCaptions" className="carousel slide" data-ride="carousel">
    <ol className="carousel-indicators">
      <li data-target="#carouselExampleCaptions" data-slide-to="0" className="active"></li>
      <li data-target="#carouselExampleCaptions" data-slide-to="1"></li>
      <li data-target="#carouselExampleCaptions" data-slide-to="2"></li>
    </ol>
    <div className="carousel-inner">
      <div className="carousel-item active">
        <img className="d-block w-100" src={lo} alt="First slide"/>
        <div className="carousel-caption d-none d-md-block">
          <h5>First slide label</h5>
          <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
        </div>
      </div>
      <div className="carousel-item">
        <img className="d-block w-100" src={log} alt="Second slide"/>
        <div className="carousel-caption d-none d-md-block">
          <h5>Second slide label</h5>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        </div>
      </div>
      <div className="carousel-item">
        <img className="d-block w-100" src={log} alt="Third slide"/>
        <div className="carousel-caption d-none d-md-block">
          <h5>Third slide label</h5>
          <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
        </div>
      </div>
    </div>
    <a className="carousel-control-prev" href="#carouselExampleCaptions" role="button" data-slide="prev">
      <span className="carousel-control-prev-icon" aria-hidden="true"></span>
      <span className="sr-only">Previous</span>
    </a>
    <a className="carousel-control-next" href="#carouselExampleCaptions" role="button" data-slide="next">
      <span className="carousel-control-next-icon" aria-hidden="true"></span>
      <span className="sr-only">Next</span>
    </a>
  </div>
</div>
      <div className='container text-center'>


        <h3 className='mt-4'>Posts</h3>

        <PostRender post={this.props} likes={this.state.likes} />
        { posts.previous !== null
          ? <button
            className='btn btn-default mx-2 my-4 rounded-0'
            onClick={
              () => {
                this.props.fetchposts(this.props.posts.previous)
              }}>
              Previous
          </button>
          : ''}
        { posts.next !== null
          ? <button
            className='btn btn-primary mx-2 my-4'
            onClick={
              () => {
                this.props.fetchposts(this.props.posts.next)
              }}>
              Next
          </button>
          : ''}

        <Link className='btn btn-info rounded-0' to='/posts/new'>Create Post</Link>
        <button className='btn btn-info' onClick={() => {
          this.setState({ likes: likes + 1 })
        }}>Change Likes</button>
        <p>{likes}</p>
        <button className='btn btn-primary' onClick={() => {
          this.props.togg(3, value, () => {
            alert('success!!')
          })
        }}>
          Hello
        </button>
      </div></div>
    )
  }
}

PostList.propTypes = {
  posts: PropTypes.object.isRequired
}

function mapStateToProps ({ posts }) {
  return { posts: posts }
}

export default connect(mapStateToProps, { fetchposts, togg })(PostList)
